import { useEffect,useState } from "react"
import { fetchAlphaVantage } from "../coin-gecko-api/fetchAlphaVantage"
import Stock from "./Stock"
function StockList(){
    const [stocks,setStocks]=useState(null)
    useEffect(()=>{
        fetchAlphaVantage().then(data=>{setStocks(data);console.log(stocks)}).catch(err=>console.error(err))
    },[])
    useEffect(()=>{
        if(stocks){
            console.log(stocks)
        }
    },[stocks])
    return(
        <tbody>
            {stocks&& stocks.map(element =><Stock stock={element} key={element["Global Quote"]["01. symbol"]}/>)}
        </tbody>
    )
}
export default StockList
